import React from "react";
import "./contact.css";
import SocialContact from "./social-contact";
function Contact() {
  return (
    <div className="contact">
    <div className="contact-container">
      <div className="contact-left">
        <p>click here</p>
        <SocialContact />
        </div>
      </div>
    </div>
  );
}

export default Contact;
